sys_variable_value.value:
(function execute(inputs, outputs) {

    var rankings = (function(algorithmGr, elo1, elo2, criteriaRelevance,judgeEligibility,age) {

        var elo_difference_weighting = Math.abs(elo1-elo2) * algorithmGr.elo_weight;
        var criteria_relevance_weighting = parseInt(criteriaRelevance * algorithmGr.criterion_weight);
        var judge_eligibility_weighting = parseInt(judgeEligibility * algorithmGr.opponent_weight);
        var age_weighting = parseInt(age * algorithmGr.age_weight);
        var selection_priority = elo_difference_weighting +
         criteria_relevance_weighting + 
         judge_eligibility_weighting + 
         age_weighting;
        
        return {
            selection_priority: selection_priority,
            elo_difference_weighting: elo_difference_weighting,
            criteria_relevance_weighting: criteria_relevance_weighting,
            judge_eligibility_weighting: judge_eligibility_weighting,
            age_weighting: age_weighting
        };
    })(inputs.algorithm, inputs.elo1,inputs.elo2, inputs.criteria_relevance, inputs.judge_eligibility, inputs.age);

    outputs.selection_priority = rankings.selection_priority;
    outputs.elo_difference_weighting = rankings.elo_difference_weighting;
    outputs.criteria_relevance_weighting = rankings.criteria_relevance_weighting;
    outputs.judge_eligibility_weighting = rankings.judge_eligibility_weighting;
    outputs.age_weighting = rankings.age_weighting;

})(inputs, outputs);

